const setUpGalleryZakladki = (() => {

   const data = {
      'Męski': [
         './public/assets/męski/20210810_192710.jpg',
         './public/assets/męski/20210810_192718.jpg',
         './public/assets/męski/20210810_192839.jpg',
         './public/assets/męski/20210810_192846.jpg',
         './public/assets/męski/20210810_192916.jpg',
         './public/assets/męski/20210810_192943.jpg',
      ],
      'Damski': [
         './public/assets/damski/20210810_183350.jpg',
         './public/assets/damski/20210810_183402.jpg',
         './public/assets/damski/20210810_183418.jpg',
         './public/assets/damski/20210810_183522.jpg',
         './public/assets/damski/20210810_191938.jpg',
         './public/assets/damski/20210810_191959.jpg',
         './public/assets/damski/20210810_192011.jpg',
         './public/assets/damski/20210810_192018.jpg',
         './public/assets/damski/20210810_192053.jpg',
         './public/assets/damski/20210810_192107.jpg',
      ],
      'Pielęgnacja dłoni i stóp': [
         './public/assets/pielęgnacja dłoni i stóp/20210810_184255.jpg',
         './public/assets/pielęgnacja dłoni i stóp/20210810_184356.jpg',
         './public/assets/pielęgnacja dłoni i stóp/20210810_184833.jpg',
         './public/assets/pielęgnacja dłoni i stóp/20210810_185931.jpg',
         './public/assets/pielęgnacja dłoni i stóp/20210810_185949.jpg',
      ],
      'Kosmetyka': [
         './public/assets/gabinet kosmetyczny/20210810_185613.jpg',
         './public/assets/gabinet kosmetyczny/20210810_185649.jpg',
         './public/assets/gabinet kosmetyczny/20210810_185729.jpg',
         './public/assets/gabinet kosmetyczny/20210810_185851.jpg',
         './public/assets/gabinet kosmetyczny/20210810_185931.jpg',
         './public/assets/gabinet kosmetyczny/20210810_185949.jpg',

      ],
      'Solarium': [
         './public/assets/solarium/20210810_193818.jpg',
         './public/assets/solarium/20210810_193834.jpg',
         './public/assets/solarium/20210810_193846.jpg',
      ],
   };

   const galeria = document.querySelector('.grid-gallery')

   const capitalizeFirstLetter = (string) => {
      return string.charAt(0).toUpperCase() + string.slice(1);
   }


   const createZakladki = (div) => {
      const keys = Object.keys(data);
      keys.forEach((el, i) => {

         div.innerHTML += `<button  
            class="text-lg text-gray-300 hover:text-gray-50 hover:bg-black-700 p-3 rounded mx-2 ${el.replace(/ /g, '')}">${el}</button>`
      })
   }

   const setUpContent = () => {
      const keys = Object.keys(data);
      galeria.innerHTML = ''
      if (keys.indexOf(decodeURI(capitalizeFirstLetter(window.location.hash.slice(1)))) != -1) {
         data[decodeURI(capitalizeFirstLetter(window.location.hash.slice(1)))].forEach(src => {
            galeria.innerHTML += `
            <img loading="lazy" class="grid-gallery-item" src="${src}" alt="">`
         })
      } else {
         data.Męski.forEach(src => {
            galeria.innerHTML += `
            <img loading="lazy" class="grid-gallery-item" src="${src}" alt="">`
         })
      }
   }


   const setBgZakladek = () => {
      const zakladkiContainer = document.querySelector('#zakladki-container')
      const zakladki = zakladkiContainer.querySelectorAll(`button`)
      const keys = Object.keys(data);

      zakladki.forEach((z) => { z.classList.remove('bg-black-700') })

      if (keys.indexOf(decodeURI(capitalizeFirstLetter(window.location.hash.slice(1)))) != -1) {
         const zakladka = zakladkiContainer.querySelector(`button.${decodeURI(capitalizeFirstLetter(window.location.hash.slice(1))).replace(/ /g, '')}`)
         zakladka.classList.add('bg-black-700')

      } else {
         const zakladka = zakladkiContainer.querySelector(`button`)
         zakladka.classList.add('bg-black-700')
      }
   }

   const setListenerZakladki = () => {

      const zakladki = document.querySelectorAll('#zakladki-container button')

      zakladki.forEach((el, i) => {
         el.addEventListener('click', () => {

            cennik.innerHTML = '';
            window.location.assign(`/cennik.html#${el.innerText}`)
            data[el.innerText].forEach(zestaw => {
               cennik.innerHTML += `
                  <li class="flex justify-between">
                  <span>${zestaw[0]}</span>
                  <span class="text-right">
                     ${zestaw[1]} PLN
                  </span>
               </li>`
            })

            zakladki.forEach((z, index) => {
               if (index === i) {
                  z.classList.add('bg-black-700')
               } else {
                  z.classList.remove('bg-black-700')
               }
            })

         })
      })

   }

   const setUpChangingCennik = () => {
      const zakladkiContainer = document.querySelector('#zakladki-container');

      createZakladki(zakladkiContainer);
      setListenerZakladki();
      setUpContent();
      setBgZakladek();

      window.addEventListener('popstate', () => {
         console.log(decodeURI(window.location.hash))
         setUpContent();
         setBgZakladek();
      })

   }


   const start = () => {

      setUpChangingCennik();

   }

   return { start }
})()

export { setUpGalleryZakladki }
